import React from 'react';
import { pseudoRandomBytes } from 'crypto';

const content = (props) => {
    return(
        <div class="content">
          <div><img src={props.name}/>         {props.name}    @{props.tweetid}</div>
          <br/>

          <div>{props.content}</div>

        <div><p>comment   retweet     like</p></div>
      </div>
    );
}


export default content
